import '../css/HomePage.css';
import footballLogo from '../img/football.jpg';

function HomePage() {

    return(
        <div>
            <div className="header">
                <img className="footballLogo" src={footballLogo} alt="football logo" />
                <h1 className="title">KickBuddy</h1>
                <img className="footballLogo" src={footballLogo} alt="football logo" />
            </div>
            <div class="container">
                <div class="play"><button>PLAY</button></div>
                <div class="profile"><button>PROFILE</button></div>
                <div class="login"><button>LOGIN</button></div>
                <div class="settings"><button>SETTINGS</button></div>
            </div> 
        </div>    
    );
    
}

export default HomePage;
